import Classes from "./Header.module.css";

const Header = () => {
  return (
    <header className={Classes.Header}>
      <img
        src="https://www.svgrepo.com/show/6396/star.svg"
        loading="lazy"
      ></img>
      <img
        src="https://www.svgrepo.com/show/6396/star.svg"
        loading="lazy"
      ></img>
    </header>
  );
};

export default Header;
